import React, { useEffect, useState } from "react";
import "../Home.css";

export default function Home() {
  const [students, setStudent] = useState([]);

  useEffect(() => {
    fetch("/student")
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        setStudent(data.student);
      });
  }, []);

  return (
    <div>
      <div id="div1">
        <p>All students are assigned</p>
      </div>
      <div id="div2">
        <p>No student assigned to you</p>
      </div>
    </div>
  );
}
